First Generative Artwork, 100 % coded on p5.js. As artist Jared Tarbell once said : "Machines can help us see things we cannot see with our own eyes" "Blossoming Edges" is a collection inspired by the concept of emergence using generative algorithms to showcase the beauty of organic shapes and the power of chance.

Created from random vertices that form into intricate, abstract shapes, each piece is one of a kind. Different backgrounds made from lines and rectangles put the shape in focus and emphasize its uniqueness.

Hope you will enjoy ! Made with Love.

